import logo from './assets/img/admin.png';
import './assets/css/App.css';
import Router from './routes/Routes';

function App() {
  return (

      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            FiuFit Administration
          </p>

        </header>
        <Router></Router>
      </div>



  );
}

export default App;
